import React from 'react';
import { Form } from '@unform/web';
import './App.css';

import { Input } from '../../unform-web/src/components/Form/Input';

function App() {
  return (
    <div className="App">
      <h1> Hello World </h1>
      <Form>
        <Input name="email" />
        <Input name="email" />
        <Input name="email" />
        <Input name="email" />
      </Form>
    </div>
  )
}

export default App;
